import React from 'react';
import './RegAccMain.scss';

const RegAccMain = (props) => {
    return(
        <div className="RegAccMain">
            <h3>KROK 1</h3>
            <label htmlFor="u_login">Login</label>
            <input required type="text" name="u_login" title="Proszę wpisać login"></input>
            <label htmlFor="u_mail">E-mail</label><br/>
            <input required type="text" name="u_mail" title="Proszę podać adres mail"></input><br/>
            <label htmlFor="u_password">Hasło</label><br/>
            <input required type="text" name="u_password" title="Nowe hasło"></input><br/>
            <label htmlFor="u_passwordAgain">Powtórz hasło</label><br/>
            <input required  type="numeric" name="u_passwordAgain" title="Powtórz hasło"></input>
        </div>
    )
}

export default RegAccMain;
